import React from "react";
import NotLoggedIn from "./NotLoggedIn";

export default class LoginForm extends React.Component {
  constructor() {
    super();
    this.state = {};
  }
  isLoggedIn = false;
  render() {
    return (
      <div>
        {this.isLoggedIn ? <div>Welcome</div> : <NotLoggedIn></NotLoggedIn>}
      </div>
    );
  }
}
